import React from "react";
import { dogs } from "./App";

function Dogs(){

    {console.log(`this is: ${dogs}`)};
    return(
        <>
        <h1>All Dogs Here!</h1>
        {dogs.map(d => (
            <div>
                {d.name}
                <img 
                src={d.src} 
                alt={d.name}
                style={{ width: '150px', height: '150px', objectFit: 'cover' }}
                />
            </div>

        ))}
        </>
    )
}

export default Dogs;
